  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108215 includes chemical,
  discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
  Gulf of St. Lawrence, Labrador Sea and North Atlantic Ocean from 1999-06-27 to 1999-07-13
  and retrieved during cruise 18HU19990627 (18HU99022_1 and Hudson 99022). These data
  include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT
  (CONCENTRATION), PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE and methyl chloroform
  (MC). The instruments used to collect these data include Alkalinity titrator, CTD,
  Coulometer for DIC measurement and bottle. These data were collected by Robert Gershey
  of BDR Research Ltd and Peter E. (retired) Jones of Bedford Institute of Oceanography
  as part of the WOCE_AR07W_1999 data set.nnThe International CLIVAR Global Ocean
  Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
